import React, { Component } from "react";
import "./IntroSection.scss";
import FadeInAnimation from "../Components/FadeInAnimation";

class App extends Component {
  render() {
    return (
      <section className="intro_section">
        <div className="introbox">
          <FadeInAnimation className="backgroundlines_bottom" direction="down">
            hi
          </FadeInAnimation>
          <div className="backgroundlines_bottom"></div>
          <div className="introbox_namelightleft">Justin</div>
          <div className="introbox_namelightright">Poon</div>
          <div className="introbox_bio">
            Welcome to my portfolio, I am a final year Civil Engineering student
            based in Melbourne, Australia. Explore this portfolio to find out
            more!
          </div>
        </div>
      </section>
    );
  }
}
export default App;
